import React from 'react';
import styled from 'styled-components';

const SidebarParent = styled.div`
  background: #a5cff7;
  width: 250px;
  height: 100vh;
`;

function Sidebar() {
    return (
        <>
            <SidebarParent>
                <h2> I'm on the Sidebar</h2>
                <p>Love me or else!!</p>
            </SidebarParent>
        </>
    );
}

export default Sidebar;
